const MultiForm = formType => {
	if (!formType) {
	} else if (formType == "job") {
		let steps = "4";
	}
	return (
		<div className="multi-form">
			<div className="tlwrapper">
				<div className="steps">
					<div className="step ">
						<div className="marker complete-step">1</div>
					</div>
					<div className="step ">
						<div className="marker">2</div>
					</div>

					<div className="step ">
						<div className="marker">3</div>
					</div>
					<div className="step ">
						<div className="marker">4</div>
					</div>
				</div>
			</div>
			<form>
				<div className="slide active-slide" id="slide1">
					<p>How many repples is the bag of bobbish worth?</p>
					<input type="text" placehulder="repples???"></input>
					<button className="btn"></button>
				</div>
				<div className="slide" id="slide2">
					<p>How many repples is the plumbus worth?</p>
					<input type="text" placehulder="repples???"></input>{" "}
				</div>
				<div className="slide" id="slide3">
					<p>How many repples are the crushed red party cups worth?</p>
					<input type="text" placehulder="repples???"></input>{" "}
				</div>
			</form>
			<style jsx>{`
				.multi-form {
					height: 100%;
					width: 100%;
					display: block;
				}
				.slide {
					opacity: 0;
				}
				.active-slide {
					opacity: 1;
				}

				.steps {
					clear: both;
					list-style: none;
					padding-left: 0%;
					display: flex;
					height: 5px;
					margin: 50px;
					width: auto;
					overflow: visible;
					background: #d0d0d0;
					justify-content: flex-start;
					align-items: center;
				}
				.step {
					width: 25%;
				}

				.marker {
					background: #d0d0d0;
					border-radius: 50%;
					padding: 15px;
					width: 15px;
					height: 15px;
					display: flex;
					justify-content: Center;
					align-items: center;
					color: #fff;
					margin: 5%;
				}
				.marker:nth-child(1) {
					margin-left: 0;
				}
				.step {
					display: flex;
					justify-content: center;
				}
				.step:last-of-type {
					justify-content: flex-end;
				}

				.step:first-of-type {
					justify-content: flex-start;
				}
				.step:last-of-type .marker {
					margin-right: 0 !important;
				}
				.marker::after {
					content: "";
					display: block;
					position: absolute;
					width: 25%;
					background: red;
					cursor: pointer;
					height: 10px;
					background: #d0d0d0;
				}
				.complete-step {
					background: blue;
				}
			`}</style>
		</div>
	);
};

export default MultiForm;
